import React, { useEffect } from "react";
import Hero from "./Hero";
import CardOne from "./CardOne";
import CardTwo from "./CardTwo";
import CardThree from "./CardThree";

const CardGallery = () => {
  useEffect(() => {
    Aos.init({ duration: 2000 });
  }, []);
  return (
    <div>
      <div className="w-full h-full p-10">
        {/* Heading */}
        <div className="text-3xl md:text-4xl lg:text-6xl font-bold text-gray-700 text-center items-center justify-center mb-6">
          Hosting Plans
        </div>
        <div className="text-md text-gray-500 text-center font-semibold items-center justify-center px-12">
          We offer the fastest Linux servers fully equipped with your own
          dedicated memory and storage.
        </div>
      </div>
      {/* Three cards */}
      <div className="max-w-7xl mx-auto grid grid-cols-1 xl:grid-cols-3 w-full mt-6">
        <CardOne />
        <CardTwo />
        <CardThree />
      </div>
    </div>
  );
};

export default CardGallery;
